import React from "react";
import "./style.css";
import Close from "./close/index.js";
import Search from "./search/index.js";

function Modal() {
    return (
        <div className="modal">
            <div className="modal-container">
                <Close />
                <Search />
            </div>
        </div>
    );
}



export default Modal;
